import React, { useState } from 'react'
import axios from 'axios'
export const RegisterUser = () => {
  const [Username, setUsername] = useState("")
  const [email, setemail] = useState("")
  const [ComformPassword, setComformPassword] = useState("")
  const [BloadGru, setBloadGru] = useState("")

  const bloodGroups = [
    'A+',
    'A-',
    'B+',
    'B-',
    'AB+',
    'AB-',
    'O+',
    'O-',
  ];

  const headers = {
    'Content-Type': 'application/json;charset=UTF-8',
    "Access-Control-Allow-Origin": "*",
  }


  const handleSubmit = () => {
    axios({
      method: 'post',
      url: 'https://localhost:5001/api/UserLoginDetails/InsertUserDetails',
      data: {
        ID: 1,
        Username: Username,
        password: "password",
        EmailId: email,
        BloadGru: BloadGru,
        CreateAT: new Date(),
        UpdateAT: new Date()
      },
      headers

    });




  }

  return (
    <>
      <div> <h3>User Registertion</h3> </div>

      <form>
        <div className="mb-3">
          <label className="form-label">User Name</label>
          <input type="Username" className="form-control"
            onChange={(e) => setUsername(e.target.value)}
          />
        </div>
        <div className="mb-3">
          <label className="form-label">Email address</label>
          <input type="email" className="form-control" aria-describedby="emailHelp"
            onChange={(e) => setemail(e.target.value)}
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Password</label>
          <input type="password" className="form-control" aria-describedby="Password" />
        </div>

        <div className="mb-3">
          <label className="form-label">Comform password</label>
          <input type="Password" className="form-control" aria-describedby="Comform Password"
            // onChange={(e) => setComformPassword(e.target.value)}
            blur

          />


        </div>
        <div className="mb-3">
          <label className="form-label">Bload Group :</label>
          <select value={BloadGru} onChange={(e) => setBloadGru(e.target.value)}>
            <option value="">Select an option</option>
            {bloodGroups.map((option) => (
              <option key={option} value={option}>
                {option}
              </option>
            ))}
          </select>
        </div>
       
        <button type="submit" className="btn btn-primary"
          onClick={handleSubmit}

        >Submit</button>
      </form>

    </>
  )
}
export default RegisterUser
